import React, { Component } from "react";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="text-center" style={{ color: "green", fontSize: "20px" }}>
        <div>
          <h1>Hello world</h1>
        </div>
      </div>
    );
  }
}

export default App;
